{
    "packages": [
        {
            "name": "laravel/framework",
            "version": "8.0.0",
            "source": {
                "type": "git",
                "url": "https://github.com/laravel/framework.git",
                "reference": "8.0.0"
            },
            "dist": {
                "type": "zip",
                "url": "https://api.github.com/repos/laravel/framework/zipball/8.0.0",
                "reference": "8.0.0"
            },
            "require": {
                "php": "^7.3|^8.0",
                "fideloper/proxy": "^4.4",
                "fruitcake/laravel-cors": "^2.0",
                "guzzlehttp/guzzle": "^7.0.1",
                "laravel/tinker": "^2.0"
            },
            "autoload": {
                "classmap": [
                    "database/seeds",
                    "database/factories"
                ],
                "psr-4": {
                    "App\\": "app/"
                }
            },
            "extra": {
                "laravel": {
                    "dont-discover": []
                }
            }
        }
    ],
    "content-hash": "abc123def456",
    "minimum-stability": "stable",
    "prefer-stable": true,
    "repositories": [],
    "require-dev": {
        "phpunit/phpunit": "^9.0"
    },
    "config": {
        "optimize-autoloader": true,
        "preferred-install": "dist"
    },
    "scripts": {
        "post-autoload-dump": [
            "Illuminate\\Foundation\\ComposerScripts::postAutoloadDump",
            "php artisan package:discover --ansi"
        ]
    }
}